Clone_of_Avg_Days_1.query:
q = load "${App.Datasets.HLS_Care_Request8_tp.FullyQualifiedName}";
q = filter q by 'Case.IsClosed' == "false";
q_B = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(static_2.selection, 0, "Text2").asString()}}];
q_C = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(static_2.selection, 0, "Text3").asString()}}];
result = group q by all full, q_B by all full, q_C by all;
result = foreach result generate avg(q.'Days_Since_Created') as 'A', avg(q_B.'Days_Since_Created') as 'B', avg(q_C.'Days_Since_Created') as 'C';
result = foreach result generate round('B',0) as 'Avg Age', round('C',0) as 'Avg Age Previous', round((B-C),0) as 'Change_In_Days';

care_request_by_case_1.query:
q = load "${App.Datasets.HLS_Care_Request8_tp.FullyQualifiedName}";
q = filter q by 'Case.Status' != "Closed";
q = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(static_2.selection, 0, "Text2").asString()}}];
q_B = filter q by 'Due_days' >= 0 && 'Due_days' <= 2;
result = group q by 'ClinicalCaseType' full, q_B by 'ClinicalCaseType';
result = foreach result generate coalesce(q.'ClinicalCaseType', q_B.'ClinicalCaseType') as 'ClinicalCaseType', count(q) as 'A', count(q_B) as 'B';
result = order result by ('A' desc);
result = limit result 2000;

Clone_of_Total_Reque_1.query:
q = load "${App.Datasets.HLS_Care_Request8_tp.FullyQualifiedName}";
q = filter q by 'Case.IsClosed' == "false";
q_B = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(static_2.selection, 0, "Text2").asString()}}];
q_C = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(static_2.selection, 0, "Text3").asString()}}];
result = group q by all full, q_B by all full, q_C by all;
result = foreach result generate unique(q.'Id') as 'A', unique(q_B.'Id') as 'B', unique(q_C.'Id') as 'C';
result = foreach result generate 'B' as 'Total Care Requests', 'C' as 'Previous Total Care Request', (B-C)/C as 'Percentage_Change_In_CareRequest';

Clone_of_BreachedSLA_2.query:
q = load "${App.Datasets.HLS_Care_Request8_tp.FullyQualifiedName}";
q = filter q by 'Case.IsClosed' == "false";
q_B = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(static_2.selection, 0, "Text2").asString()}}] && 'Breached_SLA' == "Yes";
q_C = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(static_2.selection, 0, "Text3").asString()}}] && 'Breached_SLA' == "Yes";
result = group q by all full, q_B by all full, q_C by all;
result = foreach result generate unique(q.'Id') as 'A', unique(q_B.'Id') as 'B', unique(q_C.'Id') as 'C';
result = foreach result generate (B/A) as 'Percent of Breached SLA', (C/A) as 'Percent of Breached SLA Previous', ((B/A)-(C/A))/(C/A) as 'Percentage_Change_In_CareRequest';

CareRequestDetails_1.query:
q = load "${App.Datasets.HLS_Care_Request8_tp.FullyQualifiedName}";
q = filter q by 'Case.Status' != "Closed";
q = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(static_2.selection, 0, "Text2").asString()}}];
q = foreach q generate 'Account.Name' as 'Account.Name', 'Breached_SLA' as 'Breached_SLA', 'CareRequestRecordType.Name' as 'CareRequestRecordType.Name', 'Case.Priority' as 'Case.Priority', 'Case.Status' as 'Case.Status', 'ClinicalCaseType' as 'ClinicalCaseType', 'Due_Date_Format' as 'Due_Date_Format', 'Name' as 'Name';
q = limit q 100;
